    function showToast(data) {
      if (data.length > 0) {
        var userData = data[currentIndex];
        var amount = userData.amount;
        var progressText;
        var percentage;
        var target;

        // Loop through targets to find the next milestone
        for (var i = 0; i < targets.length; i++) {
          target = targets[i];
          if (amount < target.amount) {
            percentage = Math.round((target.amount - amount) / target.amount * 100); // Calculate percentage remaining correctly
            progressText = target.message.replace("{%}", percentage);
            break;
          }
        }

        // If no target found, it means the user has qualified for all trips
        if (!progressText) {
          progressText = 'Congratulations! ' + userData.name + ' has qualified for all trips!';
        }

        $("#userimagequalification").attr("src", userData.image1 || 'https://idpdefault.s3.ap-south-1.amazonaws.com/709063dd03e641c258920230203182358.jpg'); // Replace with actual image URL or default image path
        $("#usernamequalification").text(userData.name);
        $("#usercontentqualification").text(progressText);
        $("#createdonqualification").text(); // Adjust as needed

        // console.log(progressText);

        if (percentage < 80) {
          $(".gstoastt").addClass("show");
        }

        setTimeout(function () {
          $(".gstoastt").removeClass("show");
        }, 10000); // Adjust the duration as needed

        // Update the index to show the next user data in the next call
        currentIndex = (currentIndex + 1) % data.length;
      }
    }

