    function addInput() {
        // Check if all required fields in the current row are filled
        const currentRow = document.querySelector('.singleEarning:last-child'); // Get the last row
        const inputs = currentRow.querySelectorAll('input[required]'); // Get all required inputs in that row
        let allFilled = true;

        inputs.forEach(input => {
            if (!input.value) {
                allFilled = false; // Set to false if any required input is empty
            }
        });

        if (!allFilled) {
            alert('Please fill in all fields before adding another entry.');
            return; // Stop the function if not all fields are filled
        }
        // Create a new row for inputs
        var newInputRow = `
                            <div class="singleEarning">
                                <div class="title">
                                    <h4>Please fill your details</h4>
                                    <button type="button" class="btn" onclick="removeInput(this)"><i class="fa-regular fa-trash-can"></i></button>
                                </div>
                                <div class="row align-items-center position-relative">
                                    <div class="col-md-6 mb-3">
                                        <div class="form-floating">
                                            <input type="text" name="source[]" class="form-control" placeholder="Source" required>
                                            <label for="Source">Source</label>
                                        </div>
                                    </div>
                                    <div class="col-md-6 mb-3">
                                        <div class="form-floating">
                                            <input type="number" name="income[]" class="form-control" placeholder="Income" required>
                                            <label for="Income">Income</label>
                                        </div>
                                    </div>
                                    <div class="col-md-6 mb-3">
                                        <div class="form-floating">
                                        <input type="text" name="from[]" class="form-control form_datetime2" placeholder="From Date" required>
                                        <label for="Source">Starting Date</label>
                                        </div>
                                    </div>                       
                                    <div class="col-md-6 mb-3">
                                        <div class="form-floating">
                                        <input type="text" name="to[]" class="form-control form_datetime2" placeholder="To Date" required>
                                        <label for="Source">Complete Date</label>
                                        </div>
                                    </div>
                                </div>
                            </div>
    `;

        // Append the new row to the income-inputs div
        document.getElementById('income-inputs').insertAdjacentHTML('beforeend', newInputRow);
        // Re-initialize daterangepicker for the newly added input
        initializeDateRangePicker();
    }

    function removeInput(button) {
        // Remove the current row
        button.closest('.singleEarning').remove();
    }
